import React from 'react';
import './ReportsTable.css';  

import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@mui/material';

const ReportsTable = ({ reports }) => {
  return (
    <TableContainer component={Paper} style={{ margin: '20px auto', width: '90%' }}>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell><strong>Test</strong></TableCell>
            <TableCell><strong>Version-Build</strong></TableCell>
            <TableCell><strong>Cluster</strong></TableCell>
            <TableCell><strong>Result</strong></TableCell>
            <TableCell><strong>Failure Reason</strong></TableCell>
            <TableCell><strong>Runtime</strong></TableCell>
            <TableCell><strong>Date</strong></TableCell>
            <TableCell><strong>User</strong></TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {reports.map((report) => (
            <TableRow key={report.id}>
              <TableCell>{report.test}</TableCell>
              <TableCell>{report.versionBuild}</TableCell>
              <TableCell>{report.cluster}</TableCell>
              <TableCell>{report.result}</TableCell>
              <TableCell>{report.failureReason || 'N/A'}</TableCell>
              <TableCell>{report.runtime}</TableCell>
              <TableCell>{report.date}</TableCell>
              <TableCell>{report.user}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
};

export default ReportsTable;
